Replace string value with float value<p>My data structure looks like this:</p>

<pre><code>{
    customer: 10000001,
    metadata: {
        foo: '10.4',
        bar: 99
    }
}
</code></pre>

<p>Unfortunately there is a mistake in my dataset as all values for <code>'metadata.foo'</code> have been stored as a string. There are 500 affected documents (the value is optional), so it is not possible to correct the values manually.</p>

<p>Is it possible to replace the string value with its float value if it is existing at all by terminal without executing some JavaScript code?</p>

<p>I'm thinking of something like:</p>

<pre><code>db.collection.update(
    {
        'metadata.foo': { $exists: true }
    },
    {
        $toDecimal: &lt;expression??&gt;
    }
)
</code></pre>

