MongoDB performance issue, probably due to projection getting ignored in NodeJS project, using native MongoDB driver<p><strong>Long version:</strong> (Scroll down for TLDR)</p>

<p>I have a collection 'libraries'. A library may be of type "template" or "standard-template" (in this scenario). If it is owned by a organization it will contain a "organization_id" (which is otherwise null), if it is unowned but a organization has access to it this id will be added to a "organizations" array. Libraries with type "template" are always owned, those with type "standard-template" are never owned.
The query to do so looks like:</p>

<pre><code>{
    "$or": [{
        "organization_id": id,
        "type": "template"
    }, {
        "organization_id": null,
        "type": "standard-template",
        "organizations": id
    }]
}
</code></pre>

<p>I have a index like {"organization_id": 1, "type": 1} and there aren't many "standard-template" libraries.
A explain will tell me that this query takes +- 4ms to execute and returns 50 documents.</p>

<p>In my NodeJS application it will take about 12 seconds. This is likely due to the size of each document (which may vary from a few KB to 10MB).</p>

<p>I'm trying to limit this using a projection to only receive the relevant fields, this however, appears to be ignored entirely.
I've tried all kinds of variations of the code below, but none seemed to make a difference.</p>

<p><strong>TLDR</strong></p>

<p>The projection value in my code seems to be ignored. In the example I attempt to retrieve only "_id" fields, yet end up with the entire documents.</p>

<p><strong>Code used for testing</strong></p>

<pre><code>let id = ObjectID('5e56503cafc87b893b92827c');
let start = performance.now();
let find = mongodb.collection('libraries').find(
    {
        "$or": [
            {"organization_id": id, "type": "template"},
            {"organization_id": null,"type": "standard-template", "organizations": id}
        ]
    }, {_id: 1});

while (await find.hasNext()) {
    const doc = await find.next();
    console.log(doc); //HUGE! way more than just _id!
}

console.log(performance.now() - start); //about 12000 ms
</code></pre>

<p>Even shorter test code:</p>

<pre><code>console.log(await mongodb.collection('libraries').findOne({}, {_id: 1})); //HUGE!
</code></pre>

<p>In any examples or docs I found it is done seemingly the same way. I'm pretty sure I've done it this way in the past.
Am I overseeing something? Any insights are very much appreciated.</p>

